import React, { Component } from 'react';
import './Hero.css';

class Hero extends Component {
  render() {
    return (
      <div className="hero">
        <h1>{this.props.postTitle}</h1>
        <p>
              I got my first PM internship
        </p>
      </div>
    );
  }
}

export default Hero;
